          "text": "346; Pub. L. 110\u201328,\ntitle VIII, \u00a7 8212(a)\u2013(c), May 25, 2007, 121 Stat. 192; Pub. L. 110\u2013185, title I, \u00a7 102(a), Feb. 13, 2008, 122 Stat.\n618; Pub. L. 110\u2013343, div. C, title VII, \u00a7 711(a), Oct. 3, 2008, 122 Stat. 3928; Pub. L. 111\u20135, div. B, title I,\n\u00a7 1202(a), Feb. 17, 2009, 123 Stat. 335; Pub. L. 111\u2013147, title II, \u00a7 201(a), Mar. 18, 2010, 124 Stat. 77; Pub. L.\n111\u2013240, title II, \u00a7 2021(a)\u2013(d), Sept. 27, 2010, 124 Stat. 2556, 2558; Pub. L. 111\u2013312, title IV, \u00a7 402(a)\u2013(e), title\nVII, \u00a7 737(b)(3), Dec. 17, 2010, 124 Stat. 3306, 3307, 3318; Pub. L. 112\u2013240, title III, \u00a7 315(a)\u2013(d), Jan. 2, 2013,\n126 Stat. 2330, 2331; Pub. L. 113\u2013295, div. A, title I, \u00a7 127(a)\u2013(d), Dec. 19, 2014, 128 Stat. 4017; Pub. L. 114\u2013113,\ndiv. Q, title I, \u00a7 124(a)\u2013(f), Dec. 18, 2015, 129 Stat. 3053; Pub. L. 115\u201397, title I, \u00a7\u00a7 11002(d)(1)(R), 13101(a)\u2013(c),\nDec. 22, 2017, 131 Stat. 2060, 2101, 2102; Pub. L. 115\u2013141, div. U, title IV, \u00a7 401(b)(15)(A), (B), Mar. 23, 2018,\n132 Stat. 1202.) **Editorial Notes** Amendments **Statutory Notes and Related Subsidiaries** Effective Date of 2018\nAmendment Effective Date of 2017 Amendment Effective Date of 2015 Amendment Effective Date of 2014\nAmendment Effective Date of 2013 Amendment Effective Date of 2010 Amendment Effective Date of 2009\nAmendment Effective Date of 2008 Amendment Effective Date of 2007 Amendment Effective Date of 2004\nAmendment Effective Date of 2003 Amendment Effective Date of 1996 Amendment Effective Date of 1993\nAmendment Effective Date of 1990 Amendment Effective Date of 1988 Amendment Effective Date of 1986\nAmendment Effective Date of 1984 Amendment Effective Date of 1983 Amendment Effective Date of 1982\nAmendment Effective Date of 1981 Amendment Effective Date of 1976 Amendment Effective Date of 1969\nAmendment Effective Date of 1962 Amendment Effective Date Savings Provision\n\n\nA taxpayer may elect to treat the cost of any section 179 property as an expense which is not chargeable to capital\naccount. Any cost so treated shall be allowed as a deduction for the taxable year in which the section 179 property\nis placed in service.\n\n\nThe aggregate cost which may be taken into account under subsection (a) for any taxable year shall not exceed\n$1,000,000.\n\n\nThe limitation under paragraph (1) for any taxable year shall be reduced (but not below zero) by the amount by\nwhich the cost of section 179 property placed in service during such taxable year exceeds $2,500,000.\n\n\nThe amount allowed as a deduction under subsection (a) for any taxable year (determined after the application of\nparagraphs (1) and (2)) shall not exceed the aggregate amount of taxable income of the taxpayer for such taxable\nyear which is derived from the active conduct by the taxpayer of any trade or business during such taxable year.\n\n\nFor purposes of this paragraph, taxable income derived from the conduct of a trade or business shall be computed\nwithout regard to the deduction allowable under this section.",
