          "text": "Title 26\u2014 INTERNAL REVENUE CODE \u00a7 1397A. Increase in expensing under section 179 (a) General rule In the\ncase of an enterprise zone business, for purposes of section 179\u2014 (1) the limitation under section 179(b)(1) shall be\nincreased by the lesser of\u2014 (A) $35,000, or (B) the cost of section 179 property which is qualified zone property\nplaced in service during the taxable year, and (2) the amount taken into account under section 179(b)(2) with\nrespect to any section 179 property which is qualified zone property shall be 50 percent of the cost thereof. (b)\nRecapture (c) Termination (Added Pub. L. 103\u201366, title XIII, \u00a7 13301(a), Aug. 10, 1993, 107 Stat. 552; amended\nPub. L. 105\u201334, title IX, \u00a7 952(c), Aug. 5, 1997, 111 Stat. 887; Pub. L. 106\u2013554, \u00a7 1(a)(7) [title I, \u00a7 114(a), (b)], Dec.\n21, 2000, 114 Stat. 2763, 2763A\u2013601; Pub. L. 116\u2013260, div. EE, title I, \u00a7 118(b), Dec. 27, 2020, 134 Stat. 3051.)\n**Editorial Notes** Amendments **Statutory Notes and Related Subsidiaries** Effective Date 2020 Amendment\nEffective Date of 2000 Amendment\n\nRules similar to the rules under section 179(d)(10) shall apply with respect to any qualified zone property which\nceases to be used in an empowerment zone by an enterprise zone business.\n\n\nThis section shall not apply to any property placed in service in taxable years beginning after December 31, 2020.\n\n\n2020\u2014Subsec. (c). Pub. L. 116\u2013260 added subsec. (c).\n\n\n2000\u2014Subsec. (a)(1)(A). Pub. L. 106\u2013554, \u00a7 1(a)(7) [title I, \u00a7 114(a)], substituted \u201c$35,000\u201d for \u201c$20,000\u201d.\n\n\nSubsec. (c). Pub. L. 106\u2013554, \u00a7 1(a)(7) [title I, \u00a7 114(b)], struck out heading and text of subsec. (c). Text read as\nfollows: \u201cFor purposes of this section, qualified zone property shall not include any property substantially all of the\nuse of which is in any parcel described in section 1391(g)(3)(A)(iii).\u201d\n\n\n1997\u2014Subsec. (c). Pub. L. 105\u201334 added subsec. (c).\n\n\nAmendment by Pub. L. 116\u2013260 applicable to taxable years beginning after Dec. 31, 2020, see section 118(e) of\ndiv. EE of Pub. L. 116\u2013260, set out as a note under section 1391 of this title.\n\n\nPub. L. 106\u2013554, \u00a7 1(a)(7) [title I, \u00a7 114(c)], Dec. 21, 2000, 114 Stat. 2763, 2763A\u2013601, provided that: \u201cThe\namendments made by this section [amending this section] shall apply to taxable years beginning after December\n31, 2001.\u201d",
