          "text": "Title 26\u2014 INTERNAL REVENUE CODE \u00a7 179. Election to expense certain depreciable business assets (a) Treatment\nas expenses (b) Limitations (1) Dollar limitation (2) Reduction in limitation (3) Limitation based on income from\ntrade or business (A) In general (B) Carryover of disallowed deduction The amount allowable as a deduction under\nsubsection (a) for any taxable year shall be increased by the lesser of\u2014 (i) the aggregate amount disallowed under\nsubparagraph (A) for all prior taxable years (to the extent not previously allowed as a deduction by reason of this\nsubparagraph), or (ii) the excess (if any) of\u2014 (I) the limitation of paragraphs (1) and (2) (or if lesser, the aggregate\namount of taxable income referred to in subparagraph (A)), over (II) the amount allowable as a deduction under\nsubsection (a) for such taxable year without regard to this subparagraph. (C) Computation of taxable income (4)\nMarried individuals filing separately In the case of a husband and wife filing separate returns for the taxable year\u2014\n(A) such individuals shall be treated as 1 taxpayer for purposes of paragraphs (1) and (2), and (B) unless such\nindividuals elect otherwise, 50 percent of the cost which may be taken into account under subsection (a) for such\ntaxable year (before application of paragraph (3)) shall be allocated to each such individual. (5) Limitation on cost\ntaken into account for certain passenger vehicles (A) In general (B) Sport utility vehicle For purposes of\nsubparagraph (A)\u2014 (i) In general The term \u201csport utility vehicle\u201d means any 4-wheeled vehicle\u2014 (I) which is\nprimarily designed or which can be used to carry passengers over public streets, roads, or highways (except any\nvehicle operated exclusively on a rail or rails), (II) which is not subject to section 280F, and (III) which is rated at\nnot more than 14,000 pounds gross vehicle weight. (ii) Certain vehicles excluded Such term does not include any\nvehicle which\u2014 (I) is designed to have a seating capacity of more than 9 persons behind the driver\u2019s seat, (II) is\nequipped with a cargo area of at least 6 feet in interior length which is an open area or is designed for use as an\nopen area but is enclosed by a cap and is not readily accessible directly from the passenger compartment, or (III)\nhas an integral enclosure, fully enclosing the driver compartment and load carrying device, does not have seating\nrearward of the driver\u2019s seat, and has no body section protruding more than 30 inches ahead of the leading edge of\nthe windshield. (6) Inflation adjustment (A) In general In the case of any taxable year beginning after 2018, the\ndollar amounts in paragraphs (1), (2), and (5)(A) shall each be increased by an amount equal to\u2014 (i) such dollar\namount, multiplied by (ii) the cost-of-living adjustment determined under section 1(f)(3) for the calendar year in\nwhich the taxable year begins, determined by substituting \u201ccalendar year 2017\u201d for \u201ccalendar year 2016\u201d in\nsubparagraph (A)(ii) thereof. (B) Rounding (c) Election (1) In general An election under this section for any taxable\nyear shall\u2014 (A) specify the items of section 179 property to which the election applies and the portion of the cost\nof each of such items which is to be taken into account under subsection (a), and (B) be made on the taxpayer\u2019s\nreturn of the tax imposed by this chapter for the taxable year. Such election shall be made in such manner as the\nSecretary may by regulations prescribe.",
