          "text": "1981\u2014Pub. L. 97\u201334 amended section generally, changing its content from provisions that formerly made available\nan additional first-year depreciation allowance for small businesses to provisions allowing a taxpayer to elect to\ntreat the cost of section 179 property as an expense which is not chargeable to capital account, with any cost so\ntreated to be allowed as a deduction for the taxable year in which the section 179 property is placed in service.\n\n\n1976\u2014Subsecs. (c)(1), (2), (d)(6)(B). Pub. L. 94\u2013455, \u00a7 1906(b)(13)(A), struck out \u201cor his delegate\u201d after\n\u201cSecretary\u201d.\n\n\nSubsec. (d)(8), (9). Pub. L. 94\u2013455, \u00a7 213(a), added par. (8) and redesignated former par. (8) as par. (9).\n\n\nSubsec. (e). Pub. L. 94\u2013455, \u00a7 1906(b)(13)(A), struck out \u201cor his delegate\u201d after \u201cSecretary\u201d.\n\n\n1969\u2014Subsec. (d). Pub. L. 91\u2013172 substituted reference to component members of a controlled group for reference\nto members of an affiliated group in pars. (2)(B) and (b), and substituted definition of controlled group for\ndefinition of affiliated group in par. (7).\n\n\n1962\u2014Subsec. (d)(5). Pub. L. 87\u2013834, \u00a7 13(c)(2)(A), substituted \u201csection 167(h)\u201d for \u201csection 167(g)\u201d.\n\n\nSubsec. (d)(8). Pub. L. 87\u2013834, \u00a7 13(c)(2)(B), substituted \u201csection 167(g)\u201d for \u201csection 167(f)\u201d.\n\n\nPub. L. 115\u2013141, div. U, title IV, \u00a7 401(b)(15)(C), Mar. 23, 2018, 132 Stat. 1202, provided that: \u201cThe amendments\nmade by this paragraph [amending this section] shall not apply to property placed in service before the date of the\nenactment of this Act [Mar. 23, 2018].\u201d\n\n\nAmendment by section 11002(d)(1)(R) of Pub. L. 115\u201397 applicable to taxable years beginning after Dec. 31, 2017,\nsee section 11002(e) of Pub. L. 115\u201397, set out as a note under section 1 of this title.\n\n\nPub. L. 115\u201397, title I, \u00a7 13101(d), Dec. 22, 2017, 131 Stat. 2102, provided that: \u201cThe amendments made by this\nsection [amending this section] shall apply to property placed in service in taxable years beginning after December\n31, 2017.\u201d\n\n\nPub. L. 114\u2013113, div. Q, title I, \u00a7 124(g), Dec. 18, 2015, 129 Stat. 3053, provided that:\u201c(1)Extension.\u2014Except as\nprovided in paragraph (2), the amendments made by this section [amending this section] shall apply to taxable\nyears beginning after December 31, 2014.\u201c(2)Modifications.\u2014The amendments made by subsections (c)(2) and (e)\n\n[amending this section] shall apply to taxable years beginning after December 31, 2015.\u201d\n\n\nPub. L. 113\u2013295, div. A, title I, \u00a7 127(e), Dec. 19, 2014, 128 Stat. 4018, provided that: \u201cThe amendments made by\nthis section [amending this section] shall apply to taxable years beginning after December 31, 2013.\u201d\n\n\nPub. L. 112\u2013240, title III, \u00a7 315(e), Jan. 2, 2013, 126 Stat. 2331, provided that: \u201cThe amendments made by this\nsection [amending this section] shall apply to taxable years beginning after December 31, 2011.\u201d\n\n\nPub. L. 111\u2013312, title IV, \u00a7 402(f), Dec. 17, 2010, 124 Stat. 3307, provided that: \u201cThe amendments made by this\nsection [amending this section] shall apply to taxable years beginning after December 31, 2011.\u201d",
