          "page_label": "2",
          "text": "2\nunder \u00a7 179(b)(2) (the \u00a7 179(b)(2) limitation).  Prior to the enactment of ATRA, the \u00a7 \n179(b)(1) limitation was $500,000 for taxable years beginning in 2010 and 2011, \n$125,000 for taxable years beginning in 2012, and $25,000 for taxable years beginning \nafter 2012.  The \u00a7 179(b)(2) limitation was $2,000,000 for taxable years beginning in \n2010 and 2011, $500,000 for taxable years beginning in 2012, and $200,000 for taxable \nyears beginning after 2012.  ATRA changed the limitations for taxable years beginning \nin 2012 or 2013 to $500,000 under \u00a7 179(b)(1) and $2,000,000 under \u00a7 179(b)(2).     \nSection 179(b)(3)(A) provides that a taxpayer\u2019s \u00a7 179 deduction for any taxable \nyear, after application of the \u00a7 179(b)(1) and (2) limitations, is limited to the taxpayer\u2019s \ntaxable income for that taxable year that is derived from the taxpayer\u2019s active conduct of \nany trade or business during that taxable year (\u201ctaxable income limitation\u201d).  Section \n179(b)(3)(B) provides that the amount of any cost of \u00a7 179 property elected to be \nexpensed in a taxable year that is disallowed as a \u00a7 179 deduction under the taxable \nincome limitation may be carried forward for an unlimited number of years (\u201ccarryover of \ndisallowed deduction\u201d) and may be deducted under \u00a7 179(a) in a future taxable year \nsubject to the same limitations.   \nSection 179(d)(1) defines \u00a7 179 property as meaning \u00a7 1245 property (as defined \nin \u00a7 1245(a)(3)) that is:  (1) tangible property to which \u00a7 168 applies and that is acquired \nby purchase (as defined in \u00a7 179(d)(2) and \u00a7 1.179-4(c) of the Income Tax Regulations) \nfor use in the active conduct of a trade or business; or (2) computer software described \nin \u00a7 179(d)(1)(A)(ii) and that is acquired by purchase for use in the active conduct of a \ntrade or business.  Section 179 property does not include any property described in",
