          "text": "Application of Section 179(f) for Qualified Real Property \n \n \nNotice 2013-59 \n \n \nI. PURPOSE \n \n This notice provides guidance with respect to issues related to the enactment of \n\u00a7 315(d) of the American Taxpayer Relief Act of 2012, Pub. L. No. 112-240, 126 Stat. \n2313 (January 2, 2013) (ATRA), which extended the application of \u00a7 179(f) of the \nInternal Revenue Code from any taxable year beginning in 2010 or 2011 to any taxable \nyear beginning in 2010, 2011, 2012, or 2013.  For these years, \u00a7 179(f) expands the \ndefinition of property qualifying for \u00a7 179 to include qualified real property (as defined in \n\u00a7 179(f)(1) and (2)).  This notice also provides allocation methodologies for determining \nthe portion of the gain that is attributable to \u00a7 1245 property upon the sale or other \ndisposition of qualified real property.  \nII. BACKGROUND \n \n(1) In general\n.  Section 179(a) allows a taxpayer to elect to treat the cost (or a \nportion of the cost) of any \u00a7 179 property as an expense for the taxable year in which \nthe taxpayer places the property in service.  Section 179(b)(1) and section 179(b)(2) \nprescribe a dollar limitation on the aggregate cost of \u00a7 179 property that can be treated \nas an expense under \u00a7 179(a).  The dollar limitation is the amount under \u00a7 179(b)(1) \n(the \u00a7 179(b)(1) limitation), reduced (but not below zero) by the amount by which the \ncost of \u00a7 179 property placed in service during the taxable year exceeds the amount",
