          "text": "9\n(3) Examples. \n    (a) Example 1 -- Disallowed \u00a7 179 deduction and allocation of the carryover of \ndisallowed deduction to qualified real property.  During 2012, Company Y, a calendar \nyear taxpayer, purchased and placed in service equipment that costs $100,000 and is \n\u00a7 179 property, and qualified real property that costs $200,000.  For 2012, Company Y \ndid not have any other asset purchases and did not have any carryover of disallowed \ndeduction from prior taxable years, and has a taxable income limitation of $180,000.  \nFor 2012, Company Y elected to apply \u00a7 179(f) and elected under \u00a7 179(a) to expense \nthe entire cost of the equipment and the entire cost of the qualified real property.  \nBecause of the taxable income limitation, the maximum \u00a7 179 deduction Company Y \ncan claim for 2012 is $180,000.  As a result, Company Y has a $120,000 carryover of \ndisallowed deduction to 2013.  This $120,000 carryover amount is allocated pro rata \nbetween the qualified real property and equipment placed in service by Company Y \nduring 2012.  Thus, $80,000 of the carryover amount is allocated to the qualified real \nproperty and $40,000 of the carryover amount is allocated to the equipment.  \n2012 \u00a7 179 Carryover Amount       $120,000 \nAllocation Ratio ($200,000 QRP / $300,000 Total \u00a7 179 Property)         66.67%  \nCarryover Amount Allocated to Qualified Real Property        $80,000 \n \n2012 \u00a7 179 Carryover Amount       $120,000 \nAllocation Ratio ($100,000 Equipment / $300,000 Total \u00a7 179 Property)        33.33%  \nCarryover Amount Allocated to Equipment         $40,000 \n \n   (b) Example 2 \u2013 Treatment of the carryover of disallowed deduction attributable \nto qualified real property in a taxable year beginning after 2013.  The facts are the same",
