          "text": "1 \n \n2024 Limitations Adjusted as Provided in Section 415(d), etc. \n \nNotice 2023-75 \nSection 415 of the Internal Revenue Code (\u201cCode\u201d) provides for dollar limitations \non benefits and contributions under qualified retirement plans. Section 415(d) requires \nthat the Secretary of the Treasury annually adjust these limits for cost-of-living \nincreases. Other limitations applicable to deferred compensation plans are also affected \nby these adjustments under section 415. Under section 415(d), the adjustments are to \nbe made under adjustment procedures similar to those used to adjust benefit amounts \nunder section 215(i)(2)(A) of the Social Security Act. \nCost-of-Living Adjusted Limits for 2024 \nEffective January 1, 2024, the limitation on the annual benefit under a defined \nbenefit plan under section 415(b)(1)(A) of the Code is increased from $265,000 to \n$275,000. \nFor a participant who separated from service before January 1, 2024, the \nparticipant\u2019s limitation under a defined benefit plan under section 415(b)(1)(B) is \ncomputed by multiplying the participant\u2019s compensation limitation, as adjusted through \n2023, by 1.0351. \nThe limitation for defined contribution plans under section 415(c)(1)(A) is \nincreased in 2024 from $66,000 to $69,000. \nThe Code provides that various other dollar amounts are to be adjusted at the \nsame time and in the same manner as the dollar limitation of section 415(b)(1)(A). After \ntaking into account the applicable rounding rules, the amounts for 2024 are as follows: \nThe limitation under section 402(g)(1) on the exclusion for elective deferrals \ndescribed in section 402(g)(3) is increased from $22,500 to $23,000. \nThe annual compensation limit under sections 401(a)(17), 404(l), 408(k)(3)(C), \nand 408(k)(6)(D)(ii) is increased from $330,000 to $345,000. \nThe dollar limitation under section 416(i)(1)(A)(i) concerning the definition of \u201ckey \nemployee\u201d in a top-heavy plan is increased from $215,000 to $220,000. \nThe dollar amount under section 409(o)(1)(C)(ii) for determining the maximum \naccount balance in an employee stock ownership plan subject to a 5-year \ndistribution period is increased from $1,330,000 to $1,380,000, while the dollar \namount used to determine the lengthening of the 5-year distribution period is \nincreased from $265,000 to $275,000.",
