          "text": "taxable year.  Assuming that the entire taxable year of a qualified individual is within the \napplicable period, the base housing amount for 2024 is $20,240 ($126,500 x .16). \nSimilarly, the housing expense amount is also limited, based on a percentage of \nthe maximum foreign earned income exclusion amount. Specifically, the limit on such \nhousing expenses generally equals 30 percent of the maximum foreign earned income \nexclusion amount (computed on a daily basis), multiplied by the number of days in the \napplicable period for which the taxpayer is a qualified individual. See \u00a7 911(c)(2)(A) and \n(d)(1). Thus, under this general limitation, a qualified individual whose entire taxable \nyear is within the applicable period is limited to maximum housing expenses of $37,950 \n($126,500 x .30) for 2024. However, section 911(c)(2)(B) authorizes the Secretary to \nissue regulations or other guidance to adjust the percentage under section \n911(c)(2)(A)(i) (which determines the limit on housing expenses) based on geographic \ndifferences in housing costs relative to housing costs in the United States. Pursuant to \nthis authority, the Department of the Treasury (Treasury Department) and the Internal \nRevenue Service (IRS) have published annual notices concerning the limitation on the \nsection 911 housing cost amounts since the 2006 taxable year. \nFor more background on the foreign housing exclusion, see \nhttps://www.irs.gov/individuals/international-taxpayers/foreign-housing-exclusion-or-\ndeduction. \nSECTION 3. TABLE OF ADJUSTED HOUSING LIMITATIONS FOR 2024 \nThe following table provides adjusted limitations on housing expenses (in lieu of \nthe otherwise applicable limitation of $37,950) for 2024. All amounts are in U.S. dollars.",
