          "text": "8\n2010, 2011, 2012, or 2013 and some or all of the cost of that qualified real property is \ndisallowed as a \u00a7 179 deduction under the taxable income limitation for that taxable \nyear, the aggregate amount of the carryover of disallowed deduction for that taxable \nyear is attributed entirely to the qualified real property.  \n(2) Section 179 property includes qualified real property and other properties.  If \na taxpayer elects to expense under \u00a7 179(a) qualified real property and other types of \n\u00a7 179 property for any taxable year beginning in 2010, 2011, 2012, or 2013 and some \nor all of the cost of the \u00a7 179 property (including the qualified real property) is disallowed \nas a \u00a7 179 deduction under the taxable income limitation for that taxable year, the \naggregate amount of the carryover of disallowed deduction for that taxable year must be \nallocated pro rata between the qualified real property and the other types of \u00a7 179 \nproperty.  Pursuant to \u00a7 179(f)(4)(D), the aggregate amount of the carryover of \ndisallowed deduction for the taxable year that is allocated to the qualified real property \nis determined by multiplying the aggregate amount of the carryover of disallowed \ndeduction for the taxable year by a percentage that equals: \n   (a) the aggregate amount attributable to qualified real property placed in \nservice during such taxable year, increased by the portion of any amount carried over to \nsuch taxable year from a prior taxable year which is attributable to qualified real \nproperty, divided by  \n   (b) the total amount of \u00a7 179 property placed in service during such taxable \nyear, increased by the aggregate amount carried over to such taxable year from any \nprior taxable year.",
